import React, { useEffect, useState } from "react";
import { testBackend } from "./api";

function App() {
  const [message, setMessage] = useState("Loading...");

  useEffect(() => {
    testBackend().then((msg) => setMessage(msg));
  }, []);

  return (
    <div>
      <h1>Frontend + Backend Working</h1>
      <p>Backend says: {message}</p>
    </div>
  );
}

export default App;
